<#
.Synopsis
	PowerShell Script that exports or imports the contact list and groups for the currently signed in Skype for Business/Lync client account.

.DESCRIPTION
	Leveraging the Lync Client SDK this PowerShell script will either export or import the contact list including groups for the account signed into the Skype for Business or Lync client.
	
	Prerequisite:
		PowerShell v3 or newer (Windows Management Framework 3.0 https://www.microsoft.com/en-us/download/details.aspx?id=34595).

.NOTES
	NAME:			Invoke-SFBContacts.ps1
    VERSION:      	1.0
    AUTHOR:       	Michael LaMontagne 
    LASTEDIT:     	06/24/2016

V 1.0 - June 2016 -	Fast Publish.

.LINK
   Website: http://realtimeuc.com
   Twitter: http://www.twitter.com/realtimeuc
   LinkedIn: http://www.linkedin.com/in/mlamontagne/

.EXAMPLE
   .\Invoke-SFBContacts.ps1
   
	Description
	-----------
	Runs script in Default Mode, which will export the contact list to c:\temp\SFBcontacts.csv

.EXAMPLE
   .\Invoke-SFBContacts.ps1 export
   
	Description
	-----------
	Runs script in Export Mode, which will export the contact list to c:\temp\SFBcontacts.csv

.EXAMPLE
   .\Invoke-SFBContacts.ps1 export 'c:\test\contact.csv'
   
	Description
	-----------
	Runs script in Export Mode, which will export the contact list to c:\test\contact.csv

.EXAMPLE
   .\Invoke-SFBContacts.ps1 export -file 'c:\test\contact.csv'
   
	Description
	-----------
	Runs script in Export Mode, which will export the contact list to c:\test\contact.csv

.EXAMPLE
   .\Invoke-SFBContacts.ps1 import
   
	Description
	-----------
	Runs script in Import Mode, which will import the contact list from c:\temp\SFBcontacts.csv

.EXAMPLE
   .\Invoke-SFBContacts.ps1 import 'c:\test\contact.csv'
   
	Description
	-----------
	Runs script in Import Mode, which will import the contact list from c:\test\contact.csv

.EXAMPLE
   .\Invoke-SFBContacts.ps1 import -file 'c:\test\contact.csv'
   
	Description
	-----------
	Runs script in Import Mode, which will import the contact list from c:\test\contact.csv

#>
[CmdletBinding()]
param(
	[Parameter(Position=0)]
	[ValidateSet('export','import')]
	[String]$Task = 'export',
	[Parameter(Position=1)]
	[string]$File = "c:\temp\SFBcontacts.csv"
)

#Requires -Version 3

$global:results = @()
if (Test-Path $File){
	$global:results += Import-Csv -Path $File
}
elseif(!(Test-Path (Split-Path -Path $File))){
	New-Item -ItemType directory -Path (Split-Path -Path $File) | out-null
}

Function LoadLyncSDK{
	$lyncmodelBase64 = ""
	$offuceucBase64 = ""

	if(!(Test-Path -Path $env:temp\Microsoft.Lync.Model.dll)){
		$lyncmodelContent = [System.Convert]::FromBase64String($lyncmodelBase64)
		Set-Content -Path $env:temp\Microsoft.Lync.Model.dll -Value $lyncmodelContent -Encoding Byte -Force
	}
	if(!(Test-Path -Path $env:temp\Microsoft.Office.Uc.dll)){
		$offuceucContent = [System.Convert]::FromBase64String($offuceucBase64)
		Set-Content -Path $env:temp\Microsoft.Office.Uc.dll -Value $offuceucContent -Encoding Byte -Force
	}

	$sdkPath = "$env:temp\Microsoft.Lync.Model.dll"
	try{
        Import-Module $sdkPath -Force
    }
    catch{
        throw $_.Exception.Message
    }
	try{
        # Obtain the entry point to the Lync.Model API
        $global:SFBclient = [Microsoft.Lync.Model.LyncClient]::GetClient()
    }
    catch{
        throw $_.Exception.Message
    }
}

Function Export-SFBContacts{
	LoadLyncSDK
	$sipAddress = 11
	$SFBself = $global:SFBclient.Self	 
	$SFBgroups = $SFBself.contact.ContactManager.Groups

	foreach ($SFBgroup in $SFBgroups){			   
	   if ($SFBgroup.Name -notlike "Most Used Contacts"){
			$SFBgn = $SFBgroup.Name
			foreach ($SFBcontact in $SFBgroup){
				$SFBc = [string]$SFBcontact.GetContactInformation($sipaddress)
				$SFBdetails = @{
					Key = ($SFBgn+$SFBc).ToLower()
					Group    = $SFBgn                 
					SIP      = $SFBc 
				}                           
				$global:results += New-Object PSObject -Property $SFBdetails           
			}
		}
	}

	$global:results | sort Key -Unique | export-csv -Path $File -NoTypeInformation
}

function New-LyncCustomGroup{
#function based on: https://gist.github.com/lpaglia/7930170
    [cmdletbinding()]
    Param(
        [Parameter(Mandatory=$true,Position=0)]
        [string]$Name
    )

    begin{
        $state=New-Object -TypeName System.Object               
        $callback = [AsyncCallback]{
            #http://stackoverflow.com/questions/16281955/using-asynccallback-in-powershell
            param($asyncResult)
            # callback code
            if ($asyncResult.isCompleted){
                $global:SFBclient.ContactManager.EndAddGroup($asyncResult)
            }
        }
    }
	
    process{     
        try{
            $SFBclient.ContactManager.BeginAddGroup($Name,$callback,$state)
        }
        catch{
            throw $_.Exception.Message
        }
    }
}

function Add-LyncContact{
#function based on: https://gist.github.com/lpaglia/7930170
    [cmdletbinding()]
    Param(
        [Parameter(Mandatory=$true,Position=0)]
        [string]$ContactUri,
        [Parameter(Mandatory=$true,Position=1)]
        [string]$GroupName
    )

    begin{
        $myGroup=$global:SFBclient.ContactManager.Groups | Where-Object {$_.Name -eq $GroupName}
        $state=New-Object -TypeName System.Object
        $callback = [AsyncCallback]{
            #http://stackoverflow.com/questions/16281955/using-asynccallback-in-powershell
            param($asyncResult)
            # callback code
            if ($asyncResult.isCompleted){
                $mygroup.EndAddContact($asyncResult)
            }
        }        
    }

    process{
        #lookup the contact in skype for business
        $contact = $global:SFBclient.ContactManager.GetContactByUri($ContactUri)
        if($contact){
            if($myGroup.Contains($Contact) -eq $false){
                try{
                   Write-Verbose "$GroupName $contact" -Verbose
                   $myGroup.BeginAddContact($contact,$callback,$state)
                   Start-Sleep -M 30
                   $global:isCompleted = $True
                }
                catch{
                    throw $_.Exception.Message
                }
            }
            else{
                  $global:isCompleted = $True         
            }
        }
    }
}

Function Import-SFBContacts{
	if (!(Test-Path $File)){
		write-output "No SFB contacts found in $File to import!"
		break
	}
	
	LoadLyncSDK
	$SFBiContacts = $global:results #| ? {$_.Group -eq "Temp"}
	$SFBiGroups = $global:results.group | Sort-Object | Get-Unique
	$SFBGroups = $global:SFBclient.ContactManager.Groups
	$SFBaddGroups = (Compare-object $SFBGroups.name $SFBiGroups | ?{$_.SideIndicator -eq "=>" -and $_.InputObject -ne "" -and $_.InputObject -ne "Most Used Contacts"}).InputObject

	foreach($SFBaddGroup in $SFBaddGroups){
	$NewGroupResult = New-LyncCustomGroup -Name $SFBaddGroup
		while(!($NewGroupResult.IsCompleted)){
			Start-Sleep -M 30
		}
	}
	
	Start-Sleep -s 1
	LoadLyncSDK
	
	foreach($SFBaddContact in $SFBiContacts){
	$global:isCompleted = $False 
	$NewContactResult = Add-LyncContact -GroupName $SFBaddContact.Group -ContactUri $SFBaddContact.Sip
	   while(!($global:isCompleted -eq $True) ){
			Start-Sleep -M 30
	   }
	}
}

switch ($Task){
	export {Export-SFBContacts}
	import {Import-SFBContacts}
}
